    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE - col1 NOT BETWEEN NULL AND + + col2 + + - 26 + col2 * - col1;
  - name: tab2

outputs:
  - name: q7560.out
    data: |
      46	51	23
      64	77	40
      75	67	58
